import { AppDispatch } from "../index";
import axios from "../../axios"
import { INews, ServerNewsResponse } from "../../models/models";

export const fetchNews = () => {
  return async (dispatch: AppDispatch) => {
    try {
      const response = await axios.get<ServerNewsResponse<INews>>('news');
      console.log(response);

    } catch (err) {
      console.log(err);
    }
  }
}
